import { Link } from "react-router-dom";

function Navbar() {
  return (
    <nav className="p-4 bg-gray-100 flex gap-4">
      <Link to="/profile">Profile</Link>
      <Link to="/register">Register User</Link>
    </nav>
  );
}

export default Navbar;
